import React from 'react';
import App from './App';
import Router from './components/Router/Router';
import { createBrowserRouter,RouterProvider} from 'react-router-dom';
import RootLayout from './components/Router/RootLayout';
import Home from './components/Router/Home';
import Contact from './components/Router/Contact';
import ProductDetails from './components/Router/ProductDetails';
import Login from './components/Router/Login';
import { Navigate,Route,Switch } from 'react-router-dom';

const Apps=()=>{
    async function EventItemhandler(expenceData){
        const response=await fetch('https://add-movies-c908f-default-rtdb.firebaseio.com/details.json',{
            method:'POST',
            body:JSON.stringify(expenceData),
            headers:{
                'content-type':'application/json'
            } 
        }
        )

    }
    return(
        <Header>
      <Switch>
        <Route path='/home' >
          <App />
        </Route>
        <Route path='/products'>
          <Router />
        </Route>
        <Route path='/store'>
          <Home />
        </Route>
        <Route path='/contact'>
            <Contact onAddDetails={EventItemhandler}/>
        </Route>
        <Route path='/home/:productId'>
            <ProductDetails/>
        </Route>
        <Route path='/login'>
            <Login/>
        </Route>
        
      </Switch>
    </Header>

    )
}
export default Apps;
